function staff_profiles() {

	if( have_rows('profile') ):
		echo '<div class="background-cover"></div>';
		echo '<div class="profile-wrap">';
	 	// loop through the rows of data
	    while ( have_rows('profile') ) : the_row();
			// vars
			$image = get_sub_field('image');
			$src = $image['url'];
			$title = ucwords(str_replace('-',' ',$image['title']));
			$content = get_sub_field('text');
			?>

			<div class="profile">
				<button data-action="open-profile-window">
					<div class="profile-image" style="background-image:url('<?php echo $src; ?>')"></div>
					<div class="profile-name"><?php echo $title; ?></div>
				</button>
				<div class="profile-window">
					<button data-action="close-profile-window" class="close-profile-window"><i class="fa fa-times" aria-hidden="true"></i></button>
					<div class="text-image" style="background-image:url('<?php echo $src; ?>')">
					</div>
					<div class="profile-text">
						<h2><?php echo $title; ?></h2>
						<?php echo $content; ?>
					</div>
				</div>

			</div>

			<?php

	    endwhile;
		echo '</div>';
	endif;
}

